export default (function(a,b,c,d){return {data:{"7wnuylGwWf":{data:{id:365,attributes:{imdbId:"tt0052638",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjNhNTEwYTMtZmUwNC00YmZkLTk2ZjQtMmE5MmE0NDIxMDkzXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"}],item_lang:{data:{id:1028,attributes:{title:"The Blue Angel",plot:"Professor Immanuel Rath (Curt Jurgens)is a martinet botany professor at a German high school who finds post cards bearing the likeness of Lola-Lola (May Britt), \"The Blue Angel\", in the possession of his pupils. He goes to the cafe where she is appearing to see if any of his pupils are there, and spots two of them. While chasing them, he encounters Lola-Lola and the troupe manager, Kiepert (Theodore Bikel.) He returns the next evening and becomes involved with Lola. His visit to the cafe, and the fact he spent the night with Lola, becomes common knowledge and he is forced to leave his school position. Despite the protests of his friends, he marries Lola, who is intrigued by the idea of being the wife of a professor. The intrigue doesn't last long, as Rath is unable to get work because of his wife. He becomes a broken character, reduced to performing odd jobs around the troupe and living off the earnings of his wife. When the troupe returns to his hometown, Kiepert brutally uses him in a magic act as a shill to attract customers from among his old students and friends. Lola meets a former lover and, as Rath is being degraded on the stage, she allows the former lover to make love to her in sight of her husband. Rath goes beserk and sets out to strangle her.",slug:"the-blue-angel"}}},books:{data:[{id:3271,attributes:{title:"Der blaue Engel",description:"Der vorliegende Roman gilt neben Heinrich Manns Werk 'Die kleine Stadt' als eine der besten Schöpfungen aus der Frühzeit des Dichters. Er erschien erstmalig im Jahre 1905 und schildert die makabre Geschichte eines professoralen Gymnasiastenschrecks, einer Spießerexistenz, die in später Leidenschaft einer Kleinstadtkurtisane verfällt und aus den gewohnten bürgerlichen Bahnen entgleist.Mit diesem Roman, dessen Verfilmung mit Emil Jannings und Marlene Dietrich unter dem Titel 'Der blaue Engel' zu einem der wenigen wirklichen Welterfolge des deutschen Films wurde, gelang Heinrich Mann eine meisterhafte Karikatur der Wilhelminischen Zeit.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UMKzAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1951-01-01",publisher:"Rowohlt Taschenbuch Verlag GmbH",subtitle:a}},{id:3272,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:c,published:"1968-01-01",publisher:a,subtitle:"Roman"}},{id:3273,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:c,published:"1971-01-01",publisher:a,subtitle:"Oder, Das Ends Eines Tyrannen, Roman"}},{id:3274,attributes:{title:"Professor Unrat. The Blue Angel",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1932-01-01",publisher:a,subtitle:a}},{id:3275,attributes:{title:"Letters of Heinrich and Thomas Mann, 1900-1949",description:"Presents the correspondence of Thomas and Heinrich Mann",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7iC7BGIcvTQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Thomas Mann",b],firstBook:c,published:"1998-01-01",publisher:"Univ of California Press",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940927115}}("","Heinrich Mann",null,"Professor Unrat"))